@VickieKarasic found some resources for nginx config for websockets:

https://www.nginx.com/blog/websocket-nginx/
https://nginx.org/en/docs/http/websocket.html

@sandbergja filled in a vital piece of the puzzle. These lines:
```
          proxy_set_header Upgrade $http_upgrade;
          proxy_set_header Connection "Upgrade";
```
mean that the incoming request should be handled by a different protocol (not HTTP/S). Those directives should only be applied to `/websocket/` and not to any other URLs (especially not to `/`, which would alter the protocol for all incoming requests to the site). With a nested definition for `/websocket/` that applied those directives only to the one URL, live updates started working.
